import logo from '../logo/logo.svg';
import styled from 'styled-components';

const Image = styled.div`
    //padding-all: 1%;
    width: 35px;
    height: 35;
    background-image: url(${logo});
`

export default function Logo() {
  return (
    <Image/>
  );
}
